import React from 'react';
import {useNavigate} from 'react-router-dom'
import './chat.css'
import Header from './Header';


const Home = () => {
  const navigate = useNavigate()
  const logoutHandler = () => {
    localStorage.token = ''
    navigate('/login')
  }
  return (
    <div style={{width: '70%'}}>
      <Header />
      <div className="home">
        <button onClick={logoutHandler}>Выйти из чата</button>
      </div>
      
    </div>
  );
};



export default Home;
